import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";

const Footer = () => {

    const year =new Date().getFullYear();
return(
    <>
        <footer className="container-fluid text-center">
            <p>copyright &#x00A9; {year}</p>
        </footer>
    </>
);
};
export default Footer;
